const Control_helperText = function({
  text = []
} = {}) {

  this.para = [];

  text.forEach((item, i) => {
    this.para.push(helper_helper({
      tag: 'p',
      text: item
    }));
  });

  this.wrap = () => {
    const formWrap = wrap_wrap();

    this.para.forEach((item, i) => {
      formWrap.appendChild(item);
    });

    return formWrap;
  };

  this.disable = () => {
    this.para.forEach((item, i) => {
      item.classList.add('disabled');
    });
  };

  this.enable = () => {
    this.para.forEach((item, i) => {
      item.classList.remove('disabled');
    });
  };

};
