;// CONCATENATED MODULE: ./src/component/control/text/index.js















const Control_text = function({
  object = {},
  path = false,
  id = 'name',
  value = false,
  min = false,
  max = false,
  placeholder = false,
  classList = [],
  labelText = 'Name',
  srOnly = false,
  action = false
} = {}) {

  this.label = label_label({
    forInput: id,
    text: labelText
  });

  if (srOnly) {
    this.label.classList.add('sr-only')
  };

  this.text = text_text({
    id: id,
    classList: classList,
    func: () => {

      if (path) {
        set({ object: object, path: path, value: this.text.value });
      };

      if (action) { action(); };

    }
  });

  if (value) {
    this.text.value = value;
  };

  if (min) {
    this.text.min = min;
  };

  if (max) {
    this.text.max = max;
  };

  if (placeholder) {
    this.text.placeholder = placeholder;
  };

  this.update = () => {

    this.text.value = get({ object: object, path: path });

  };

  this.wrap = () => {
    return wrap_wrap({
      children: [
        this.label,
        this.text
      ]
    })
  };

  this.disable = () => {
    this.label.classList.add('disabled');
    this.text.disabled = true;
  };

  this.enable = () => {
    this.label.classList.remove('disabled');
    this.text.disabled = false;
  };

};

;// CONCATENATED MODULE: ./src/component/control/select/index.js

















const Control_select = function({
  option = [],
  selected = 0,
  object = {},
  id = 'name',
  path = false,
  labelText = 'name',
  srOnly = false,
  description = false,
  action = false
} = {}) {

  this.select = select_select({
    id: id,
    option: option,
    selected: selected,
    func: () => {

      set({ object: object, path: path, value: this.select.selectedIndex });

      if (action) { action(); };

    }
  });

  this.label = label_label({
    forInput: id,
    text: labelText,
    description: description
  });

  if (srOnly) {
    this.label.classList.add('sr-only')
  };

  this.update = () => {
    this.select.selectedIndex = get({
      object: object,
      path: path
    });
  };

  this.updateOption = (option, selectedIndex) => {

    if (option.length > 0) {

      clearChildNode(this.select);

      option.forEach((item, i) => {

        this.select.appendChild(
          node(
            'option:' +
            item +
            '|value:' +
            trimString(item).replace(/\s+/g, '-').toLowerCase()
          )
        );

      });

      if (selectedIndex || selectedIndex === 0) {
        this.select.selectedIndex = selectedIndex;
      };

    };

  };

  this.selected = () => {
    return this.select.selectedIndex;
  };

  this.wrap = () => {
    return wrap_wrap({
      children: [
        this.label,
        this.select
      ]
    })
  };

  this.disable = () => {
    this.label.classList.add('disabled');
    this.select.disabled = true;
  };

  this.enable = () => {
    this.label.classList.remove('disabled');
    this.select.disabled = false;
  };

};

